import React from 'react'

const Home = () => {
  let names = 'mario';

  const handleClick = () => {
    names = 'luigi';
  }
  return (
    <div className='home'>
      <h2>HomePage</h2>
      <p>{names}</p>
      <button onClick={handleClick}>Click Me</button>
    </div>
  )
}

export default Home
